import React, { useState, useCallback } from 'react';
import Papa from 'papaparse';
import './App.css';

const App = () => {
  const [orderData, setOrderData] = useState([]);
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [uploadStatus, setUploadStatus] = useState({
    orders: false
  });
  const [processingStats, setProcessingStats] = useState({
    totalOrders: 0,
    shippedOrders: 0,
    filteredOut: 0
  });

  // Built-in shipping rates (from state_wise_shipping_rates.csv)
  const SHIPPING_RATES = {
    'ANDHRA PRADESH': 55,
    'ARUNACHAL PRADESH': 65,
    'ASSAM': 60,
    'BIHAR': 50,
    'CHHATTISGARH': 55,
    'GOA': 45,
    'GUJARAT': 50,
    'HARYANA': 48,
    'HIMACHAL PRADESH': 58,
    'JHARKHAND': 52,
    'KARNATAKA': 50,
    'KERALA': 45,
    'MADHYA PRADESH': 50,
    'MAHARASHTRA': 50,
    'MANIPUR': 60,
    'MEGHALAYA': 60,
    'MIZORAM': 60,
    'NAGALAND': 60,
    'ODISHA': 55,
    'PUNJAB': 48,
    'RAJASTHAN': 50,
    'SIKKIM': 60,
    'TAMIL NADU': 60,
    'TELANGANA': 55,
    'TRIPURA': 60,
    'UTTAR PRADESH': 52,
    'UTTARAKHAND': 55,
    'WEST BENGAL': 55
  };

  const DEFAULT_RATE = 60; // Default rate per kg if state not found

  // Parse CSV or TXT files
  const parseFile = useCallback((file, callback) => {
    const fileExtension = file.name.toLowerCase().split('.').pop();

    if (fileExtension === 'txt') {
      // Handle TXT file - assume tab-delimited Amazon report format
      const reader = new FileReader();
      reader.onload = (e) => {
        try {
          const text = e.target.result;
          const lines = text.split('\n').filter(line => line.trim());

          if (lines.length === 0) {
            setError('TXT file appears to be empty');
            return;
          }

          // Convert tab-delimited to CSV format
          const csvContent = lines.map(line => {
            // Split by tabs and wrap fields with commas in quotes
            return line.split('\t').map(field => {
              field = field.trim();
              // If field contains comma, quote it
              if (field.includes(',')) {
                return `"${field.replace(/"/g, '""')}"`;
              }
              return field;
            }).join(',');
          }).join('\n');

          // Create a blob and parse as CSV
          const csvBlob = new Blob([csvContent], { type: 'text/csv' });
          Papa.parse(csvBlob, {
            header: true,
            skipEmptyLines: true,
            complete: (results) => {
              if (results.errors.length > 0) {
                setError(`TXT to CSV conversion error: ${results.errors[0].message}`);
                return;
              }
              callback(results.data);
            },
            error: (error) => {
              setError(`Failed to parse converted CSV: ${error.message}`);
            }
          });
        } catch (error) {
          setError(`TXT file processing error: ${error.message}`);
        }
      };
      reader.onerror = () => setError('Failed to read TXT file');
      reader.readAsText(file);
    } else {
      // Handle CSV file normally
      Papa.parse(file, {
        header: true,
        skipEmptyLines: true,
        complete: (results) => {
          if (results.errors.length > 0) {
            setError(`CSV parsing error: ${results.errors[0].message}`);
            return;
          }
          callback(results.data);
        },
        error: (error) => {
          setError(`Failed to parse CSV: ${error.message}`);
        }
      });
    }
  }, []);

  // Handle order file upload
  const handleOrderUpload = useCallback((event) => {
    const file = event.target.files[0];
    if (!file) return;

    const fileExtension = file.name.toLowerCase().split('.').pop();
    if (!['txt', 'csv'].includes(fileExtension)) {
      setError('Please upload a TXT or CSV file');
      return;
    }

    setError('');
    setLoading(true);

    parseFile(file, (data) => {
      setOrderData(data);
      setUploadStatus(prev => ({ ...prev, orders: true }));
      setLoading(false);
    });
  }, [parseFile]);



  // Extract pack information from product name
  const extractPackInfo = (productName) => {
    const packOfOne = /Pack of 1/i.test(productName) ? 1 : 0;
    const packOfTwo = /Pack of 2/i.test(productName) ? 1 : 0;
    return { packOfOne, packOfTwo };
  };

  // Process orders and calculate shipping
  const processOrders = useCallback(() => {
    if (!orderData.length) {
      setError('Please upload the Amazon order report CSV file');
      return;
    }

    setLoading(true);
    setError('');

    try {

      // Filter for shipped orders only
      const shippedOrders = orderData.filter(row => {
        const orderStatus = row['order-status']?.trim().toLowerCase();
        return orderStatus === 'shipped';
      });

      // Update processing statistics
      const stats = {
        totalOrders: orderData.length,
        shippedOrders: shippedOrders.length,
        filteredOut: orderData.length - shippedOrders.length
      };
      setProcessingStats(stats);

      // Group orders by Order ID
      const orderGroups = {};
      shippedOrders.forEach(row => {
        const orderId = row['amazon-order-id']?.trim();
        const productName = row['product-name']?.trim();
        const quantity = parseInt(row.quantity) || 1;
        const state = row['ship-state']?.trim().toUpperCase();

        if (!orderId || !productName) return;

        if (!orderGroups[orderId]) {
          orderGroups[orderId] = {
            orderId,
            state,
            packOfOne: 0,
            packOfTwo: 0,
            items: []
          };
        }

        const packInfo = extractPackInfo(productName);
        orderGroups[orderId].packOfOne += packInfo.packOfOne * quantity;
        orderGroups[orderId].packOfTwo += packInfo.packOfTwo * quantity;
        orderGroups[orderId].items.push({ productName, quantity, ...packInfo });
      });

      // Calculate shipping for each order
      const processedResults = Object.values(orderGroups).map(order => {
        const totalWeight = (order.packOfOne * 0.5) + (order.packOfTwo * 1.0);
        const roundedWeight = Math.ceil(totalWeight);
        const rate = SHIPPING_RATES[order.state] || DEFAULT_RATE;
        const shippingCost = roundedWeight * rate;

        return {
          orderId: order.orderId,
          state: order.state,
          packOfOne: order.packOfOne,
          packOfTwo: order.packOfTwo,
          totalWeight: totalWeight.toFixed(2),
          roundedWeight,
          ratePerKg: rate,
          shippingCost,
          stateFound: !!SHIPPING_RATES[order.state]
        };
      });

      setResults(processedResults);
      setLoading(false);
    } catch (err) {
      setError(`Processing error: ${err.message}`);
      setLoading(false);
    }
  }, [orderData, SHIPPING_RATES]);

  // Export results to CSV
  const exportResults = useCallback(() => {
    if (!results.length) return;

    const csvContent = Papa.unparse({
      fields: [
        'Order ID',
        'State',
        'Pack of One',
        'Pack of Two',
        'Total Weight (kg)',
        'Rounded Weight (kg)',
        'Rate per kg',
        'Shipping Cost'
      ],
      data: results.map(row => [
        row.orderId,
        row.state,
        row.packOfOne,
        row.packOfTwo,
        row.totalWeight,
        row.roundedWeight,
        row.ratePerKg,
        row.shippingCost
      ])
    });

    const blob = new Blob([csvContent], { type: 'text/csv;charset=utf-8;' });
    const link = document.createElement('a');
    link.href = URL.createObjectURL(blob);
    link.download = 'shipping_calculation_results.csv';
    link.click();
  }, [results]);

  // Calculate total shipping cost
  const totalShippingCost = results.reduce((sum, order) => sum + order.shippingCost, 0);

  return (
    <div className="app">
      <div className="container">
        <header className="header">
          <h1>🚚 Amazon Order Shipping Calculator</h1>
          <p>Upload your Amazon order report to calculate shipping costs with built-in state-wise rates</p>
        </header>

        {error && (
          <div className="error-message">
            <span>⚠️ {error}</span>
          </div>
        )}

        <div className="upload-section">
          <div className="upload-card">
            <h3>📋 Amazon Order Report</h3>
            <input
              type="file"
              accept=".csv"
              onChange={handleOrderUpload}
              disabled={loading}
              className="file-input"
            />
            <div className={`status ${uploadStatus.orders ? 'success' : 'pending'}`}>
              {uploadStatus.orders ? '✅ Uploaded' : '⏳ Pending'}
            </div>
            {orderData.length > 0 && (
              <p className="file-info">{orderData.length} orders loaded</p>
            )}
          </div>

          <div className="rates-info-card">
            <h3>💰 State-wise Shipping Rates</h3>
            <div className="status success">
              ✅ Built-in Rates Loaded
            </div>
            <p className="file-info">{Object.keys(SHIPPING_RATES).length} states configured</p>
            <div className="rates-preview">
              <p><strong>Sample rates:</strong></p>
              <div className="rates-examples">
                <span>Karnataka: ₹{SHIPPING_RATES['KARNATAKA']}/kg</span>
                <span>Tamil Nadu: ₹{SHIPPING_RATES['TAMIL NADU']}/kg</span>
                <span>Maharashtra: ₹{SHIPPING_RATES['MAHARASHTRA']}/kg</span>
              </div>
            </div>
          </div>
        </div>

        <div className="action-section">
          <button
            onClick={processOrders}
            disabled={!uploadStatus.orders || loading}
            className="process-button"
          >
            {loading ? '⏳ Processing...' : '🧮 Calculate Shipping Costs'}
          </button>
        </div>

        {results.length > 0 && (
          <div className="results-section">
            <div className="results-header">
              <h2>📊 Shipping Calculation Results</h2>
              <button onClick={exportResults} className="export-button">
                📥 Export CSV
              </button>
            </div>

            <div className="table-container">
              <table className="results-table">
                <thead>
                  <tr>
                    <th>Order ID</th>
                    <th>State</th>
                    <th>Pack of One</th>
                    <th>Pack of Two</th>
                    <th>Total Weight (kg)</th>
                    <th>Rounded Weight (kg)</th>
                    <th>Rate per kg</th>
                    <th>Shipping Cost</th>
                  </tr>
                </thead>
                <tbody>
                  {results.map((row, index) => (
                    <tr key={index} className={!row.stateFound ? 'warning-row' : ''}>
                      <td>{row.orderId}</td>
                      <td>
                        {row.state}
                        {!row.stateFound && <span className="warning-badge">⚠️</span>}
                      </td>
                      <td>{row.packOfOne}</td>
                      <td>{row.packOfTwo}</td>
                      <td>{row.totalWeight}</td>
                      <td>{row.roundedWeight}</td>
                      <td>₹{row.ratePerKg}</td>
                      <td>₹{row.shippingCost}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>

            <div className="summary">
              <div className="summary-card">
                <h3>📈 Summary</h3>
                <div className="summary-stats">
                  <div className="stat">
                    <span className="stat-label">Shipped Orders Processed:</span>
                    <span className="stat-value">{results.length}</span>
                  </div>
                  <div className="stat">
                    <span className="stat-label">Total Shipping Cost:</span>
                    <span className="stat-value">₹{totalShippingCost.toLocaleString()}</span>
                  </div>
                  <div className="stat">
                    <span className="stat-label">Average Cost per Order:</span>
                    <span className="stat-value">₹{Math.round(totalShippingCost / results.length)}</span>
                  </div>
                </div>

                {processingStats.totalOrders > 0 && (
                  <div className="processing-info">
                    <h4>📋 Processing Details</h4>
                    <div className="processing-stats">
                      <div className="processing-stat">
                        <span>📦 Total Orders in File:</span>
                        <span>{processingStats.totalOrders}</span>
                      </div>
                      <div className="processing-stat">
                        <span>✅ Shipped Orders:</span>
                        <span>{processingStats.shippedOrders}</span>
                      </div>
                      {processingStats.filteredOut > 0 && (
                        <div className="processing-stat filtered">
                          <span>⏭️ Filtered Out (Non-Shipped):</span>
                          <span>{processingStats.filteredOut}</span>
                        </div>
                      )}
                    </div>
                  </div>
                )}
                {results.some(r => !r.stateFound) && (
                  <p className="warning-text">
                    ⚠️ Some states used default rate (₹{DEFAULT_RATE}/kg) - not found in rates file
                  </p>
                )}
              </div>
            </div>
          </div>
        )}

        <footer className="footer">
          <p>Built for efficient e-commerce shipping cost calculation</p>
        </footer>
      </div>
    </div>
  );
};

export default App;
